import React,{ useState } from 'react';



const Todo = ()=>{

    const [item, setItem] = useState('');
    const [completed, setCompleted] = useState('false');
    const [todolist, setPeople] = useState([]);
    

    return(
        <>
        <form action="" class="h-screen flex justify-center mt-4">
            <div class="grid justify-items-center  h-1/4 w-1/4 space-y-2 bg-red-400">
                <label htmlFor='item'>ADD Item : </label>
                <input type="item" name="item" id="item" value={item} class="w-4/5 focus:outline-none" onChange={(e) => setItem(e.target.value)}  />
                <button type='submit' class="focus:outline-none bg-gray-500 hover:bg-gray-400 text-white font-bold py-3 px-4 w- rounded" >Add Item</button>
            </div>
            
        </form>

        </>
        

    )
} 


export default Todo;
